import Link from 'next/link'

const Index = () => {
	return(
		<>
			<h1>
				Welcome to BitzPrice
			</h1>
			<Link href="/about"><a>About</a></Link>
		</>
	)
}

export default Index

// npm install --save-dev typescript @types/react @types/node
